import { Link } from "react-router-dom";
function StudentsSection() {
    return (
        <div
            style={{
                position: 'relative',
                width: '100%',
                minHeight: '550px',
                maxHeight: '600px',
                overflow: 'hidden',
                backgroundImage: 'url(/students.png)',
                backgroundSize: 'cover',
                backgroundPosition: 'left center',
                backgroundRepeat: 'no-repeat',
            }}
        >
            <div
                style={{
                    position: 'absolute',
                    top: '50%',
                    right: '0',
                    transform: 'translateY(-50%)',
                    maxWidth: '500px',
